import React, { Component } from 'react';
import FaleMais from './FaleMais'

class Planos extends Component {

  render() {
        let falemais;
    if(this.props.planos){
     falemais = this.props.planos.map(planos => {
       console.log(planos);
       return (
        <FaleMais  planos={planos} />
        );
     });
     }
    return (
      <div className="Planos">
      {falemais}
      </div>
    );
  }
}

export default Planos;
